import React, { Component } from "react";
import MuiThemeProvider from "material-ui/styles/MuiThemeProvider";
import { List, ListItem } from "material-ui/List";
import Grid from '@material-ui/core/Grid';
import FormControl from '@material-ui/core/FormControl';

export class FormUserDetails extends Component {

    handleSubmit = (evt) => {
        if (this.props.validateField()) {
            evt.preventDefault();
            return;
        } else {
            const { email, password } = this.state;
            alert(`Signed up with email: ${email} password: ${password}`);
        }


    }

    back = e => {
        e.preventDefault();
        this.props.prevStep();
    };

    render() {
        const {
            values: { username, email, location, team }
        } = this.props;
        return (
            <MuiThemeProvider>
                <React.Fragment>
                    <form>
                        <div className="container bm-padding align-self-center">


                            <div className="container-fluid align-content-center">
                                <FormControl>
                                    <h1>Confirm</h1>

                                    <List className="container">
                                        <ListItem primaryText="Username" secondaryText={username} />
                                        <ListItem primaryText="Email" secondaryText={email} />
                                        <ListItem primaryText="Location" secondaryText={location} />
                                        <ListItem primaryText="Team" secondaryText={team} />
                                    </List>

                                    <Grid className="">
                                        <button type="submit" variant="extendedFab" className="btn-success" onClick={this.handleSubmit} primary={true}>
                                            confirm and continue
								</button>

                                        <button type="submit" variant="extendedFab" className="btn-success" onClick={this.back} primary={false}>
                                            back
								</button>
                                    </Grid>
                                </FormControl>
                            </div>
                        </div>


                    </form>
                </React.Fragment>
            </MuiThemeProvider>
        );
    }
}



export default FormUserDetails;
